tables.table_schema:
CREATE TABLE Experiments (
  experiment_id UUID PRIMARY KEY,
  experiment_name TEXT,
  sample_id UUID REFERENCES Samples(sample_id),
  researcher_name TEXT
);

CREATE TABLE Protein (
    protein_id INT PRIMARY KEY,
    protein_name VARCHAR(255) NOT NULL,
    molecular_weight DECIMAL(10,2),
    amino_acid_sequence TEXT
);

CREATE TABLE Biomarker (
    biomarker_id INT PRIMARY KEY,
    biomarker_name VARCHAR(255) NOT NULL,
    detection_method VARCHAR(100),
    significance_level DECIMAL(5,2)
);
